import React from "react";

import TextField from "@mui/material/TextField";
import Box from "@mui/material/Box";

function WorkoutForm() {
  return (
    <Box
      sx={{
        "& > :not(style)": { m: 1, width: 300 },
      }}
      autoComplete="off"
      bgcolor="white"
    >
      <TextField
        id="standard-basic"
        label="Enter Today's Workout"
        variant="filled"
        color="warning"
        focused
      />
    </Box>
  );
}

export default WorkoutForm;
